import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
//import { connect } from 'react-redux';

const Post = ({ post }) => {
  const posts = post.map(post => (
    <div key={post.id} className={'post'}>
      <p> {post.name} </p>
      <p> {post.text} </p>
    </div>
  ));

  return (
    <Fragment>
      <div>
        {posts}
      </div>
    </Fragment>



  )
}

Post.propTypes = {
  post: PropTypes.array.isRequired
};

export default Post
